import React from 'react';

class Image extends React.Component {
    

    render() {

        return (
            <section class={sectionClasses}>
                <figure class='nxt-image-section__image'>
                    <img src='../../assets/img.jpg' alt=""/>
                </figure>
                <div class='nxt-image-section__text'>
                    <h2 className='nxt-image-section__head'>petlove</h2>
                </div>
            </section>
        );
    }

}

export default Image;
